import React from 'react';
import { Button } from "react-bootstrap";
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "./Maincard.css";
import tree from '../../Assets/tree.jpg';

function Maincard() {
  return (
<div className='feed'>  
<div className='container-fluid'>
<div className="row mx-auto mainrow">

<div className="card maincard">
  <div className="card-body">
 
  <img src={tree} className="img-thumbnail img" alt="maincard "/>
  <input type="text" className=" input" id="main input" placeholder="What's in your mind?"/>


  <hr/>

    <a href="#" className="link-tag">Photo or Video</a>
    <a href="#" className="link-tag">Tag</a>
    <a href="#" className="link-tag">Location</a>
    <a href="#" className="link-tag">Feelings</a>

    <Button className='btn btn-success button'>Share</Button>
  </div>
  </div>
  </div>
</div>
</div>

 
  )
}

export default Maincard
